def processInfiniteMeasures():
    airDensity = 1.225
    waterDensity = 1000

    for cMeasures in infiniteLabMeasures:
        cAngle = cMeasures["angle"]
        cStaticPH = cMeasures["staticP"]/1000
        cTotalPH = cMeasures["totalP"]/1000

        cStaticP = cStaticPH*waterDensity*g # free stream pressure
        cTotalP  = cTotalPH*waterDensity*g

        cFreeVel = np.sqrt( 2 * ( 1/airDensity ) * ( cTotalP - cStaticP ) )
        cMeasures["freeStreamVelocity"] = cFreeVel


        lowerPressureCoefficints = []
        for cLowerPressureH in cMeasures["lowerPres"]:
            cLowerPressureH /= 1000
            cLowerPressure = cLowerPressureH*waterDensity*g
            lowerPressureCoefficints.append( ( cLowerPressure - cStaticP )/(0.5 * airDensity * (cFreeVel**2)) )
        cMeasures["lowerPresCoeff"] = lowerPressureCoefficints

        upperPressureCoefficints = []
        for cUpperPressureH in cMeasures["upperPres"]:
            cUpperPressureH /= 1000
            cUpperPressure = cUpperPressureH*waterDensity*g
            upperPressureCoefficints.append( ( cUpperPressure - cStaticP )/(0.5 * airDensity * (cFreeVel**2)) )
        cMeasures["upperPresCoeff"] = upperPressureCoefficints

        print(cFreeVel)

        # now find CL -------------------
        sFD = cMeasures["lowerDists"][0]+cMeasures["upperDists"][0]
        fPointAveragePressureCo = ((upperPressureCoefficints[0]*(sFD-cMeasures["upperDists"][0]))+(lowerPressureCoefficints[0]*(sFD-cMeasures["lowerDists"][0])))/sFD
        
        lIndx = len( cMeasures["lowerDists"] )-1
        sFD = 2-(cMeasures["lowerDists"][lIndx]+cMeasures["upperDists"][lIndx])
        lPointAveragePressureCo = ((upperPressureCoefficints[lIndx]*(sFD+cMeasures["upperDists"][lIndx]-1))+(lowerPressureCoefficints[lIndx]*(sFD+cMeasures["lowerDists"][lIndx]-1)))/sFD

        adjustedUpperPressureCos = [fPointAveragePressureCo] + upperPressureCoefficints + [0]
        adjustedlowerPressureCos = [fPointAveragePressureCo] + lowerPressureCoefficints + [0]
        adjustedUpperDists = [0]+cMeasures["upperDists"]+[1]
        adjustedlowerDists = [0]+cMeasures["lowerDists"]+[1]

        cMeasures["upAdjPCofs"] = adjustedUpperPressureCos
        cMeasures["loAdjPCofs"] = adjustedlowerPressureCos
        cMeasures["upAdjDists"] = adjustedUpperDists
        cMeasures["loAdjDists"] = adjustedlowerDists

        liftCoefficient = 0
        topLiftDist = []
        botLiftDist = []
        topDragDist = []
        botDragDist = []

        # top pressures
        for i in range(0,len(adjustedUpperDists)-1):
            dist1 = adjustedUpperDists[i]
            vecM1 = -1/(np.sqrt( 1 + ( naca0020grad( dist1, True )**2 ) ))
            dl1 = adjustedUpperPressureCos[i] * vecM1
            dd1 = dl1 * -naca0020grad( dist1, True )
            
            dist2 = adjustedUpperDists[i+1]
            vecM2 = -1/(np.sqrt( 1 + ( naca0020grad( dist2, True )**2 ) ))
            dl2 = adjustedUpperPressureCos[i+1] * vecM2
            dd2 = dl2 * -naca0020grad( dist2, True )

            degToRad = np.pi/180
            dL = (np.cos( degToRad * cAngle )*(dist2-dist1)*(dl1+dl2)/2) - (np.sin( degToRad * cAngle )*(dist2-dist1)*(dd1+dd2)/2)
            liftCoefficient += dL
            topLiftDist.append( (np.cos( degToRad * cAngle )*(dl1)) - (np.sin( degToRad * cAngle )*(dd1)) )
            if ( i == len(adjustedUpperDists)-2 ):
                topLiftDist.append( (np.cos( degToRad * cAngle )*(dl2)) - (np.sin( degToRad * cAngle )*(dd2)) )
            topDragDist.append( (np.sin( degToRad * cAngle )*(dl1)) + (np.cos( degToRad * cAngle )*(dd1)) )
            if ( i == len(adjustedUpperDists)-2 ):
                topDragDist.append( (np.sin( degToRad * cAngle )*(dl2)) + (np.cos( degToRad * cAngle )*(dd2)) )


        # bot pressures
        for i in range(0,len(adjustedlowerDists)-1):
            dist1 = adjustedlowerDists[i]
            vecM1 = 1/(np.sqrt( 1 + ( naca0020grad( dist1, False )**2 ) ))
            dl1 = adjustedlowerPressureCos[i] * vecM1
            dd1 = dl1 * -naca0020grad( dist1, False )
            
            dist2 = adjustedlowerDists[i+1]
            vecM2 = 1/(np.sqrt( 1 + ( naca0020grad( dist2, False )**2 ) ))
            dl2 = adjustedlowerPressureCos[i+1] * vecM2
            dd2 = dl2 * -naca0020grad( dist2, False )

            degToRad = np.pi/180
            dL = (np.cos( degToRad * cAngle )*(dist2-dist1)*(dl1+dl2)/2) - (np.sin( degToRad * cAngle )*(dist2-dist1)*(dd1+dd2)/2)
            liftCoefficient += dL 
            botLiftDist.append( (np.cos( degToRad * cAngle )*(dl1)) - (np.sin( degToRad * cAngle )*(dd1)) )
            if ( i == len(adjustedUpperDists)-2 ):
                botLiftDist.append( (np.cos( degToRad * cAngle )*(dl2)) - (np.sin( degToRad * cAngle )*(dd2)) )
            botDragDist.append( (np.sin( degToRad * cAngle )*(dl1)) + (np.cos( degToRad * cAngle )*(dd1)) )
            if ( i == len(adjustedUpperDists)-2 ):
                botDragDist.append( (np.sin( degToRad * cAngle )*(dl2)) + (np.cos( degToRad * cAngle )*(dd2)) )

        cMeasures["liftCoefficient"] = liftCoefficient
        cMeasures["topLiftDistrobution"] = topLiftDist
        cMeasures["bottomLiftDistrobution"] = botLiftDist
        cMeasures["topDragDistrobution"] = topDragDist
        cMeasures["bottomDragDistrobution"] = botDragDist



